import React from 'react';
import '../styles/index.css';

const AnimationBody = () => {
  return (
    <div className="banner-images-container">
      <div className="banner-image">
        <img src="./assets/Humanbody.png" alt="Image 1" className="image-front" />
        <div className="circle-animation1"></div>
        <div className="circle-animation2"></div>
        <div className="circle-animation3"></div>
        <div className="circle-animation4"></div>
        <div className="circle-animation5"></div>
        <div className="circle-animation6"></div>
        <div className="circle-animation7"></div>
        <div className="circle-animation8"></div>
        <div className="circle-animation9"></div>
        <div className="circle-animation10"></div>
        <div className="circle-animation11"></div>
        <div className="circle-animation12"></div>
        <div className="circle-animation13"></div>
        <div className="circle-animation14"></div>
        <div className='text-container'>

        </div>
      </div>
    </div>
  );
};

export default AnimationBody;
